Populærvitenskapelig sammendrag:
Borevæske består av mange forskjellige ingredienser, bevisst satt sammen på bakgrunn av struktur, viskositet, polaritet, massetetthet og smøreevne, og påvirker boreeffektivitet, utstyrsslitasje og operasjonssikkerhet. Borevæske har derfor flertallige oppgaver under boreprosessen, bl.a:
- stabilisere brønntrykket; 
- fjerne bergarter/sedimentpartikler fra boreprosessen;
- smøre og kjøle borekronen og andre komponenter;
- lage en "filterkake" som hindrer borevæskefiltratet å skade formasjonen

Optimal sammensetning og prosessering av borevæske vil derfor kreve optimalisering over en rekke parametre, og uten tilstrekkelig prosessering vil komponentene i brønnvæsken skilles ut eller stivne. Dette skjer f.eks. dersom væsken blir stående lenge uten påvirkning av skjærkraft, noe som kan skje både i brønn og i lagringstanker. For å motvirke dette sirkuleres borevæske i lagringstanker gjennom skjærblandere (engelsk: "shear gun") som både bryter opp gelstrukturer og blander sammen de forskjellige bestanddelene. Dette foregår ved å kjøre væsken gjennom en dyse med høyt tykkfall (100-120 bar). Optimal prosessering og trykkfall vil være avhengig av bruksområde, ingredienser, temperatur og øvrige parametre. 
JAGTECH vil utvikle en lyddempet, slitasjebestandig, regulerbar skjærblander, som kan kobles til et automatisert styringsystem.  For å ytterligere dra nytte av automasjon, vil denne bli koblet sammen med automatiserte matere for ubrukt borevæske (premix) og additiver, samt sensorer for f.eks. massetetthet, volumstrøm og temperatur, og gi et komplett automatisert styresystem for prosessering av borevæske.
